VALUES ('8428532121383', 'Instantane Amandes Digest', 'Amandes partiellement dégraissées instantanées* (65,1%) maltodextrine de maïs* , sirop de riz* , sirop d\'agave, inuline* (fibre d\'agave*) f3%è 1,5%), algue marine calcaire ithothamnium calcareum, citrate tricalciquel, huile d\'amande* , arôme naturel d\'amande*. * = Issus de l\'agriculture biologique. 1 Ingrédient autorisé selon règlement (CE) no 889/2008 Annexe VII section A. 2 Ingrédient non disponible en bio autorisé selon règlement (CE n0834/2007 Fabriqué dans un ate ier où sont également traités des fruits secs, des produits laitiers, du soja, du sésame et du céleri. Mode d\'emploi: Dissoudre 2 - 3 cuillerées de poudre dans un verre d\'eau (environ 10 g de poudre pour 100 ml d\'eau). Les laits d\'amande bio EcoMil se consomment tel que à tout moment de la journée, froids ou chauds, dans le thé ou le café; et peuvent être aussi utilisés dans la préparation de vos recettes: sauces, gâteaux, crêpes, flans... Après ouverture, bien refermer le couvercle et consommer le produit dans les 2 mois. A conserver dans un endroit frais et sec. A consommer de préférence avant la date indiquée sous la boite. Importateur exclusif la France. pour .europlabo.com', 'https://static.openfoodfacts.org/images/products/842/853/212/1383/front_fr.4.400.jpg', '14', '1.4', '61.1', '13.1', '5.5', '14', '0.2', '0.078740157480315', '', '1');

